import React from 'react';
import Navbar from './Navbar';



export default function Profile() {
  return(
    <>
       <Navbar/>
       <div className='profile-page'>
        <div className='profile-pic'></div>
        <div className='profile-info'></div>
       </div>
    </>
  )
}
